$(document).ready(function () {
  var table = $("#everyGameTable").DataTable({
    order: [[0, "desc"]],
    data: everyGame.games,
    columns: everyGame.headers,
  });

  $("#everyGameTable tfoot th").each(function (i) {
    var title = $(this).text();
    var htmlString =
      '<input type="text" class="form-control column-search" placeholder="' +
      everyGame.headers[i].title +
      '" />';
    $(this).html(htmlString);
  });

  // Apply the search
  table.columns().every(function () {
    var that = this;

    $("input", this.footer()).on("keyup change", function () {
      if (that.search() !== this.value) {
        that.search(this.value).draw();
      }
    });
  });

  $("#everyGameTable_filter").addClass("hidden");
});

